export class Shop {
    constructor() {
        this.element = document.getElementById("shopitemholder");
        this.items = [];
        for (let i = 0; i < 10; i++) {
            let shopItem = document.createElement("div");
            shopItem.classList.add("shopitem");
            this.element.appendChild(shopItem);
            this.items.push(shopItem);
        }
    }
}
